import java.net.URL;

def invoke(msg) 
{ 

URL url = msg.get("http.request.url");
String protocol = url.getProtocol();
String host = url.getHost();
int port = url.getPort();

String data="";

if (port == -1) {
    data=String.format("%s://%s", protocol, host);
} else {
    data=String.format("%s://%s:%d", protocol, host, port);
}


        msg.put("data.wsdl.url", data);
  
return true;
}

