import java.text.ParseException;
import java.text.SimpleDateFormat;
import java.util.Date;
import java.lang.String;

def invoke(msg)         {            

	String message="";
		try {
			String date_1 = msg.get("StartDate");
			String date_2 =  msg.get("EndDate");
			
			SimpleDateFormat sdf = new SimpleDateFormat("yyyyMMdd");	
			sdf.setLenient(false);
			long date1=sdf.parse(date_1).getTime()/(24*60*60*1000);
			long date2=sdf.parse(date_2).getTime()/(24*60*60*1000);
			long date3=new Date().getTime()/(24*60*60*1000);
			
			if(date3-date1<0 ||date3-date2<0) {
				message= "Date not valid";
			}else if (date3-date1>90) {
				message= "Date not 3 month before";
			}else if( (date2-date1) >= 31||(date2-date1) <=-1) {
				message= "Date not range 0-31";
			}
		} catch (Exception e) {
			message="Date invalid "+e.getMessage();  
		}
		msg.put("bagi.error_message",message);
		//System.out.println(message);

return (message.length()<1);        
 }

