import java.util.regex.Matcher;
def invoke(msg)         
{            

def error_message = msg.get("json_errors").replaceAll("\"","");


def full_error_message = msg.get("json_errors_full");




try{ 


Matcher m = Pattern.compile("(?=(properties))").matcher(full_error_message);
List<Integer> pos = new ArrayList<Integer>();
while (m.find())
{
pos.add(m.start());
}
msg.put("pos_index",pos);
Matcher m1 = Pattern.compile("(?=(\"instance\"))").matcher(full_error_message);
List<Integer> pos1 = new ArrayList<Integer>();
while (m1.find())
{
pos1.add(m1.start());
}
msg.put("pos_index1",pos1);


int size = pos.size();
int test_size = pos.size();
def property = "";
msg.put("before setting property",property+" fields are invalid");
for(int i=0; i<size; i++){
def test = full_error_message.substring(pos.get(i),pos1.get(i));
if(property.contains(test+",")){
property = property.replaceAll(test+",",test);
test_size -=1;
}else{
property = property +test;
}

if (i == (pos.size() - 1)) {
// Last item...
property += " ";
}else{
property += ", ";
}	
msg.put("middle setting property",property+" fields are invalid");
}
msg.put("after setting property",property+" fields are invalid");



property = property.replaceAll("\"","").replaceAll("properties\\/","").replaceAll("\\}\\,","");

if(test_size>1)
{
msg.put("bagi.error_message",property+"fields are invalid");
}else{
property = property.replaceAll("\\,","");
msg.put("bagi.error_message",property+"field is invalid");
}
}
catch(Exception e){
	msg.put("Exception","excep"+e.getMessage());
	msg.put("bagi.error_message","Invalid Input");
}
msg.put("bagi.error_code","40001");
msg.put("bagi.error_http_code","400");
msg.put("bagi.rc","90");
return true;         
}

def invoke(msg)         {            

def message = msg.get("message.body");

if(message == "" || message == null){
msg.put("bagi.error_code","40001");
msg.put("bagi.error_http_code","400");
msg.put("bagi.rc","90");
	return false;
}



return true;         }

def invoke(msg)         {

def ProCode = "";
def TransactionId = "";
def MerchantId = "";


msg.put("ProCode",ProCode);
msg.put("TransactionId", TransactionId);
msg.put("MerchantId",MerchantId);

            return true;         
}

